import React from "react";
import "./Sidebar.css";

function Sidebar({ onNavigate, onLogout }) {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">TooturAI</h2>
      <ul className="nav-links">
        <li onClick={() => onNavigate("home")}>Home</li>
        <li onClick={() => onNavigate("studyGuide")}>Generate Study Guide</li>
        <li onClick={() => onNavigate("flashcards")}>Flashcards</li>
        <li onClick={() => onNavigate("studyPlan")}>Study Plan</li>
        <li onClick={() => onNavigate("practiceTests")}>Practice Tests</li>
        <li onClick={onLogout}>Logout</li>
      </ul>
    </div>
  );
}

export default Sidebar;
